(17, 'Blue', 'Absolut Vodka se hace exclusivamente a partir de ingredientes naturales y, a diferencia de lo que ocurre con muchos otros vodkas, no contiene azucar aniadido. Absolut es, de hecho, tan puro como puede ser el vodka. Aun asi, la pureza tiene un sabor: rico, con cuerpo y complejo, pero suave y maduro con el caracter distintivo del grano de trigo, seguido de un toque a frutas secas.', '786.00', '0.40', 'Suecia', 'Blue', NULL, 750, 7, 16),
(18, 'Citron', '', '877.00', '0.40', 'Suecia', 'Citron', NULL, 750, 7, 16),
(19, 'Drop Of Love', 'Absolut Drop es el Absolut Vodka clasica, producido exclusivamente con ingredientes naturales y sin azucar. El sabor es encorpado y complejo, pero con la suavidad y ligereza de la presencia de granos, acompaniado de matices de frutas secas.', '917.00', '0.40', 'Suecia', 'Drop_Of_Love', NULL, 750, 7, 16),
(20, 'Elyx', 'Absolut Elyx es un vodka de lujo cuya elaboracion se basa en los principios de la calidad, la integridad y la artesania, y con una destilacion manual en alambique de cobre que se remonta a 1921. El resultado es un vodka galardonado con premios y dotado de un rico y suave sabor. Lo llamamos seda liquida. Perfecto para preparar martinis e incluso para tomarlo solo con hielo.', '2907.00', '0.40', 'Suecia', 'Elyx', NULL, 1000, 7, 16),
(21, 'Extrakt', 'Absolut Extrakt es un licor intenso a la par que delicioso que combina el extraordinario vodka Absolut con el sabor calido y especiado del cardamomo verde, ademas de otros ingredientes secretos. Celebramos nuestro legado sueco con una apuesta moderna de los tradicionales aquavits suecos', '1018.00', '0.40', 'Suecia', 'Extrakt', NULL, 750, 7, 16),
