(258, 'Napoleon', 'El color es ambar con reflejos de color marron claro. . A la nariz, parece una buena cantidad de aromas que bien se acompania con su calidad. Los perfumes que componen el ramo olfativo , son todos claros, netos y limpios. Es facil identificar las hojas de te, la pasta, la fruta de la pasion, el olor mentas, el olor de anis y los jazmines. . En boca, la sensacion de calor justificado por el porcentaje alcoholico del destilado es agradable, pero en el mismo tiempo es crujiente. De todos modos, al final de los sabores de menta y anis salen muy bien. En el analisis de retro-olfativo, las sensaciones son generosas y confirman, por lo general, lo que hemos percibido en la nariz (anis, menta y hojas de te). Y aun asi, el alcohol se desacelera para permitir una mejor apreciacion del espiritu', '850.00', '0.40', 'Francia', 'Napoleon', NULL, 700, 45, 1),
