(303, 'Alexander Bianca', 'De color transparente brillante y cristalino. . . Con aroma a frutas frescas y flores de campo. . . En la boca resulta delicadamente fresco con retro-gusto persistente al perfume de la fruta fresca que lo caracteriza.', '3150.00', '0.38', 'Italia', 'Alexander_Bianca', NULL, 700, 59, 9),
(304, 'Alexander Platinum', 'De color trasparente y cristalino. . . En nariz, con marcados aromas de pasas de uva. Aromas intensos aportados por los vinos con los que es producida, con matices especiados que caracterizan al producto. . . En boca resulta suave, seco y persistente con un gran retrogusto a pasas.', '5980.00', '0.48', 'Italia', 'Alexander_Platinum', NULL, 700, 59, 9),
(305, 'Fernet Branca', 'Producto del ingenio y la vision de Bernandino Branca, nace en 1845 una bebida unica para la epoca. Ella es resultado de la combinacion de hierbas, cortezas, raices, frutos y cuidado artesanal, a la que su creador bautizo con el nombre de fernet. Asi nacio Fernet Branca. . . Y con el un secreto, el de su elaboracion. Respetado estrictamente durante mas de 160 anios. . . Un cautivante secreto que va de boca en boca. De pais en pais. Apreciado.', '143.00', '0.45', 'Argentina / Buenos Aires', 'Fernet_Branca', NULL, 450, 60, 7),
