(308, 'Fernet Branca Menta', 'Brancamenta fue creado por Fratelli Branca en Italia, a mediados de la decada del \'60, a partir de observar una costumbre italiana de mezclar en una copa Fernet Branca con menta. . Por su sabor placentero e intensamente refrescante Brancamenta es una bebida deliciosa para disfrutar en cualquier momento. Se puede beber con abundante hielo o combinarla con gaseosas claras como lima-limon, tonicas o agua mineral gasificada. . Ademas, por su sabor original, su distintivo aroma y ese inconfundible color verde profundo, Brancamenta es elegido para ser utilizado como base en la preparacion de los mas diversos tragos y deliciosos cocktails.', '84.00', '0.28', 'Argentina / Buenos Aires', 'Fernet_Branca_Menta', NULL, 450, 60, 7),
