(387, 'Campari', 'Una singular e inconfundible formula ha caracterizado a Campari, el aperitivo por excelencia, durante mas de 150 anios. . La inimitable formula de Campari, el aperitivo utilizado como base de muchos cocktails que se preparan en todo el mundo, permanece inalterable desde su creacion y continua siendo un secreto bien custodiado, transmitido a lo largo de los anios. . Campari es el resultado de la infusion de hierbas, plantas aromaticas y frutas en alcohol y agua, siendo estos ultimos los unicos dos ingredientes conocidos de la formula. ', '171.00', '0.29', 'Argentina / Buenos Aires', 'Campari', NULL, 450, 75, 56),
