(899, '1942', 'Celebrado en exclusivos bares de cocteles, restaurantes y clubes nocturnos, el iconico Tequila Don Julio 1942 es la eleccion de los conocedores de todo el mundo. Producido en pequenios lotes y envejecido durante un minimo de dos anios y medio, el tequila Don Julio 1942 se fabrica artesanalmente en homenaje al anio en que Don Julio Gonzalez comenzo su viaje de fabricacion de tequila.', '17499.00', '0.40', 'Mexico', '1942', NULL, 750, 144, 12),
(900, '70 Aniejo Claro', 'Presentamos el primer Aniejo Claro Tequila del mundo. . El tequila Aniejo Claro de Don Julio 70 es la culminacion de 70 anios de conocimiento, experiencia e innovacion que reune la suavidad de un tequila Blanco y la complejidad de un tequila Aniejo para una experiencia de tequila totalmente unica. El tequila Aniejo Claro de Don Julio 70 tiene una edad de dieciocho meses en barricas de roble blanco americano y luego se filtra cuidadosamente para resaltar su sabor agave crujiente.', '3450.00', '0.40', 'Mexico', '70_Aniejo_Claro', NULL, 750, 144, 12),
(901, 'Aniejo', 'Barril envejecido en lotes mas pequenios durante dieciocho meses en barricas de roble blanco americano, el Tequila Don Julio Aniejo es un testimonio del arte de hacer un tequila de sabor superior y aniejo.. . Rico, distintivo y maravillosamente complejo, su sabor logra el equilibrio perfecto entre agave, madera y toques de vainilla. La mejor experiencia limpia en un trago o simplemente en las rocas.', '6500.00', '0.40', 'Mexico', 'Aniejo', NULL, 750, 144, 12),
(902, 'Blanco', 'Usando la mejor planta de agave azul y un proceso de destilacion honrado por el tiempo, el tequila Don Julio Blanco es tequila en su forma mas verdadera.. . El tequila Don Julio Blanco es la base de la cual se derivan todas nuestras otras variantes. Comunmente conocido como tequila ?plateado?, su sabor crujiente de agave y toques de citricos lo convierten en un componente esencial para una variedad de bebidas innovadoras que incluyen margaritas. Tambien se puede disfrutar solo o sobre las rocas. Planta 100% de agave azul.. . Planta 100% de agave azul.', '4500.00', '0.40', 'Mexico', 'Blanco', NULL, 750, 144, 12),
(903, 'Reposado', 'Envejecido durante ocho meses en barricas de roble blanco americano, el tequila Don Julio Reposado es de color ambar dorado, y ofrece un acabado rico y suave, la esencia misma del tequila perfecto en barrica.. . Con un sabor suave y elegante y un aroma acogedor, el Tequila Reposado Don Julio se saborea mejor como parte de un refrescante coctel de degustacion o frio en las rocas.', '4200.00', '0.40', 'Mexico', 'Reposado', NULL, 750, 144, 12),
