(980, 'Blanco', 'Joven y fresco, el tequila El Jimador Silver se presenta con un caracter verdaderamente autentico. Esta hecho con 100% de agave Weber azul cosechado a mano y doble destilado con claridad brillante. Hemos perfeccionado las habilidades para producir un espiritu tan rico en sabor que cada sorbo cobra vida. Crujiente y lleno de sabores citricos, tomalo o agitalo.. . AROMA: Aroma fresco, rico en citricos.. COLOR: cristalino.. SABOR: Afrutado y picante equilibrado con notas herbaceas.. ACABADO: Calido y picante con notas de agave azul 100%.', '734.00', '0.40', 'Mexico', 'Blanco', NULL, 750, 153, 12),
(981, 'Reposado', 'El Jimador Reposado comienza con agave Weber azul 100% cosechado a mano, fermentado naturalmente y doble destilado. Luego disfruta de una siesta de dos meses en nuestras propias barricas de roble americano hechas a mano hasta el momento perfecto. Los resultados valen la pena la espera: un exquisito tono dorado, sabores sazonados calidos y un sabor suave y seguro de agave que realmente brilla.. . AROMA: Un aroma acogedor de vainilla, madera tostada, frutas, especias y agave cocido.. COLOR: Golden. SABOR: una rica combinacion de especias, frutas, madera, vainilla y sutiles avellanas tostadas. ACABADO: Suave y de larga duracion con los sabores calidos de la vainilla y las especias sutiles que descansan en el roble.', '734.00', '0.40', 'Mexico', 'Reposado', NULL, 750, 153, 12),
(982, 'Laborum De Parcela Chardonnay Finca Alto Los Cuises', '', '910.00', NULL, 'Argentina / Salta', 'Laborum_De_Parcela_Chardonnay_Finca_Alto_Los_Cuises', NULL, NULL, 154, 29),
